  false,\n\t\"url\": null,\n\t\"notes\": \"American woodcock related activities at
  Moosehorn National Wildlife Refuge from 21 May until 31 August 1984. The American
  Woodcock was studied from 21 May until 31 August 1984 by a summer crew of interns
  at the Moosehorn National Wildlife Refuge in Washington County, Maine. Radio telemetry
  of the birds was the focus of the study, with both diurnal and nocturnal locating
  performed daily. Four methods of capturing woodcock were used: bird dog, night-lighting,
  mist-netting, and ground traps.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
